              path="userInfo/:detailBillId"
              element={<Chitiethoadon />}
            />
            <Route path="userinfo" element={<TTngdung />} />
          </Route>
          {/* admin */}
          
        </Routes>
      </div>
    </div>
  </Router>
  );
}

export default App;
